function Product(props) {
	return (
		<div>
			<h3>Name: {props.name}</h3>
			<h3>Price: {props.price}</h3>
			<h3>Description: </h3>
			<par>{props.description}</par>
			<hr />
		</div>
	)
}


export default Product
